DROP TABLE IF EXISTS `app`;
CREATE TABLE `app` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `device_id` bigint(20) NOT NULL,
  `app_type_id` int(11) NOT NULL COMMENT 'app类型id',
  `app_name` varchar(40) DEFAULT NULL COMMENT 'app名称-appTypeName',
  `target_file_id` bigint(255) unsigned DEFAULT NULL COMMENT '目标版本',
  `target_file_name` varchar(50) DEFAULT NULL,
  `version_state` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '0-未设置目标版本，10-未设置目标已收到确认，20-已设置未确认，30-一致，40-不一致',
  `real_file_id` bigint(20) DEFAULT NULL,
  `real_file_name` varchar(50) DEFAULT NULL,
  `protocol_id` bigint(20) DEFAULT NULL,
  `protocol_name` varchar(50) DEFAULT NULL,
  `update_state` int(10) unsigned NOT NULL DEFAULT '190' COMMENT '升级状态-0-下载完成，10-正在进行MD5校验，20-MD5校验失败，30-MD5校验成功，40-准备安装，50-开始安装，60-安装中，70-安装失败，80-安装完成，90-尝试启动主程序，100-程序启动中，110-启动失败，120-启动成功，130-正在验证主程序状态，140-验证成功，150-验证失败，160-监测程序是否可以上传数据，170-通过上传数据监测，180-未通过上传数据监测，190-通过所有验证升级完成，200-尝试重新安装，210-尝试回滚版本',
  `create_user` varchar(30) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `create_user_id` bigint(20) DEFAULT NULL,
  `update_user` varchar(30) DEFAULT NULL,
  `update_user_id` bigint(20) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `ts` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unin_app_id` (`device_id`,`app_type_id`) USING BTREE,
  KEY `pk_id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='被管理的终端app列表';

