  `deviceId` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '设备号',
  `lineInfo` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '班线',
  `deviceFactoryNo` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '主机厂车辆自编号',
  `engineVinNo` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '发动机VIN码',
  `oilBoxCap` int(11) DEFAULT NULL COMMENT '油箱容量',
  `dayRunTime` int(11) DEFAULT NULL COMMENT '每日行驶时间',
  `airBottleCap` int(11) DEFAULT NULL COMMENT '气瓶容量',
  `batteryCap` int(11) DEFAULT NULL COMMENT '电池电量',
  `eleCost` int(11) DEFAULT NULL COMMENT '标准电耗',
  `gasCost` int(11) DEFAULT NULL COMMENT '标准气耗',
  `oilCost` int(11) DEFAULT NULL COMMENT '标准油耗',
  `engineModel` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '发动机型号/厂家',
  `gearBoxModel` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '变速箱型号/厂家',
  `batteryModel` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '电池型号/厂家',
  `dynamoModel` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '发电机型号/厂家',
  `tireModel` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '轮胎型号/厂家',
  `wheelaxlesModel` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '车桥型号/厂家',
  `doorpumpModel` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '门泵型号/厂家',
  `fsbSupplier` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '总线厂家',
  `heaterSupplier` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '暖风厂家',
  `wiperSupplier` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '雨刮系统厂家',
  `lightswitchsupplier` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '灯光组合开关厂家',
  `seatSupplier` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '座椅厂家',
  `tirepressureSupplier` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '胎压型号/厂家',
  `motorSupplier` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '电机型号/厂家',
  `electricboxModel` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '电器盒型号/厂家',
  `absModel` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT 'ABS 型号/厂家',
  `brakeshoreModel` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '刹车蹄片型号/厂家',
  `isReparing` varchar(1) COLLATE utf8_bin NOT NULL DEFAULT 'N' COMMENT '是否正在维修。改信息根据“车辆维护”信息，通过触发器自动修改',
  `expireDate` date DEFAULT NULL COMMENT '车辆到期日期',
  `producer` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '车辆生产厂家',
  `purchaseDate` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '购买日期',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '汽车状态：1-正常    2-故障   3-维修',
  `paymentExpiredDate` date DEFAULT NULL COMMENT '缴费到期时间',
  `online` tinyint(1) DEFAULT '0',
  `paymentStatus` tinyint(1) DEFAULT '1' COMMENT '是否欠费',
  `sim` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT 'sim卡信息',
  `vehicleSN` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '车辆编号',
  `lastDataUpTime` int(11) DEFAULT '0' COMMENT '数据最后更新时间',
  `alarm` tinyint(1) DEFAULT '0' COMMENT '是否报警',
  `lastAlarmTime` int(11) DEFAULT '0' COMMENT '报警最后更新时间',
  PRIMARY KEY (`vehicleId`),
  UNIQUE KEY `vehicleNo_UNIQUE` (`vehicleNo`),
  UNIQUE KEY `deviceId_UNIQUE` (`deviceId`),
  KEY `idx_devid_vinfo` (`deviceId`),
  KEY `idx_vehicleNo_vehi` (`vehicleNo`)
) ENGINE=InnoDB AUTO_INCREMENT=24709 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='车辆信息表';

