-- ----------------------------
-- View structure for v_vehicleinfo
-- ----------------------------
DROP VIEW IF EXISTS `v_vehicleinfo`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_vehicleinfo` AS select `company`.`name` AS `companyName`,`company`.`dept_id` AS `companyDeptId`,`subcompany`.`name` AS `subCompanyName`,`subcompany`.`dept_id` AS `subCompanyDeptId`,`vehiclegroup`.`name` AS `groupName`,`vehiclegroup`.`dept_id` AS `groupDeptId`,`line`.`name` AS `lineName`,`line`.`dept_id` AS `lineDeptId`,`v`.`vehicleId` AS `vehicleId`,`v`.`vehicleNo` AS `vehicleNo`,`v`.`deptId` AS `deptId`,`v`.`vehicleType` AS `vehicleType`,`v`.`motorType` AS `motorType`,`v`.`deviceId` AS `deviceId`,`v`.`lineInfo` AS `lineInfo`,`v`.`deviceFactoryNo` AS `deviceFactoryNo`,`v`.`engineVinNo` AS `engineVinNo`,`v`.`oilBoxCap` AS `oilBoxCap`,`v`.`dayRunTime` AS `dayRunTime`,`v`.`airBottleCap` AS `airBottleCap`,`v`.`batteryCap` AS `batteryCap`,`v`.`eleCost` AS `eleCost`,`v`.`gasCost` AS `gasCost`,`v`.`oilCost` AS `oilCost`,`v`.`engineModel` AS `engineModel`,`v`.`gearBoxModel` AS `gearBoxModel`,`v`.`batteryModel` AS `batteryModel`,`v`.`dynamoModel` AS `dynamoModel`,`v`.`tireModel` AS `tireModel`,`v`.`wheelaxlesModel` AS `wheelaxlesModel`,`v`.`doorpumpModel` AS `doorpumpModel`,`v`.`fsbSupplier` AS `fsbSupplier`,`v`.`heaterSupplier` AS `heaterSupplier`,`v`.`wiperSupplier` AS `wiperSupplier`,`v`.`lightswitchsupplier` AS `lightswitchsupplier`,`v`.`seatSupplier` AS `seatSupplier`,`v`.`tirepressureSupplier` AS `tirepressureSupplier`,`v`.`motorSupplier` AS `motorSupplier`,`v`.`electricboxModel` AS `electricboxModel`,`v`.`absModel` AS `absModel`,`v`.`brakeshoreModel` AS `brakeshoreModel`,`v`.`isReparing` AS `isReparing`,`v`.`expireDate` AS `expireDate`,`v`.`producer` AS `producer`,`v`.`purchaseDate` AS `purchaseDate`,`v`.`status` AS `status`,`v`.`paymentExpiredDate` AS `paymentExpiredDate`,`v`.`online` AS `online`,`v`.`paymentStatus` AS `paymentStatus`,`v`.`vehicleSN` AS `vehicleSN`,`v`.`lastDataUpTime` AS `lastDataUpTime`,`v`.`alarm` AS `alarm`,`v`.`lastAlarmTime` AS `lastAlarmTime`,`v`.`sim` AS `sim` from ((((`mauth_dept` `company` join `mauth_dept` `subcompany` on(((`subcompany`.`lft` > `company`.`lft`) and (`subcompany`.`rgt` < `company`.`rgt`) and (`subcompany`.`level` = 2)))) join `mauth_dept` `vehiclegroup` on(((`vehiclegroup`.`lft` > `subcompany`.`lft`) and (`vehiclegroup`.`rgt` < `subcompany`.`rgt`) and (`vehiclegroup`.`level` = 3)))) join `mauth_dept` `line` on(((`line`.`lft` > `vehiclegroup`.`lft`) and (`line`.`rgt` < `vehiclegroup`.`rgt`) and (`line`.`level` = 4)))) join `t_vehicleinfo` `v` on((`line`.`dept_id` = `v`.`deptId`))) where (`company`.`level` = 1) ;

-- ----------------------------
-- Procedure structure for api_get all_dept
-- ----------------------------
DROP PROCEDURE IF EXISTS `api_get all_dept`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `api_get all_dept`(IN `p_dept_id` int)
BEGIN
    DECLARE v_dept_id INT;
    DECLARE v_lft INT;
    DECLARE v_rgt INT;
    DECLARE v_level INT;
    DECLARE v_name VARCHAR(255);

    DROP TEMPORARY TABLE IF EXISTS tmp;
    CREATE TEMPORARY TABLE tmp AS
      SELECT
        dept_id,
        name,
        level,
        lft,
        rgt
      FROM mauth_dept
      WHERE 1 = 2;

    SELECT
      name,
      level,
      lft,
      rgt
    INTO v_name, v_level, v_lft, v_rgt
    FROM mauth_dept
    WHERE dept_id = p_dept_id;


     WHILE v_level > 0 DO
      SELECT
        dept_id,
        name,
        level,
        lft,
        rgt
      INTO v_dept_id, v_name, v_level, v_lft, v_rgt
      FROM mauth_dept
      WHERE level = v_level - 1 AND lft < v_lft and rgt > v_rgt LIMIT 1;


    END WHILE;

    SELECT *
    FROM tmp;

  END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `mauth_dept_BEFORE_INSERT`;
DELIMITER ;;
CREATE TRIGGER `mauth_dept_BEFORE_INSERT` BEFORE INSERT ON `mauth_dept` FOR EACH ROW BEGIN
  declare v_level int;
  
  select level into v_level 
   from (
     select t2.lft,t2.level
     from mauth_dept t2
     where new.lft>t2.lft and new.rgt<t2.rgt
     order by t2.lft desc) t1 limit 1;
  
  set new.level:=v_level+1;

END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `t_vehicleinfo_after_insert`;
DELIMITER ;;
CREATE TRIGGER `t_vehicleinfo_after_insert` AFTER INSERT ON `t_vehicleinfo` FOR EACH ROW BEGIN
    call update_vehicleinfo_update_time();
  END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `t_vehicleinfo_after_update`;
DELIMITER ;;
CREATE TRIGGER `t_vehicleinfo_after_update` AFTER UPDATE ON `t_vehicleinfo` FOR EACH ROW BEGIN
    if (OLD.deviceId != NEW.deviceId or OLD.deptId != NEW.deptId) THEN
          call update_vehicleinfo_update_time();
    END IF;
  END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `t_vehicleinfo_after_delete`;
DELIMITER ;;
CREATE TRIGGER `t_vehicleinfo_after_delete` AFTER DELETE ON `t_vehicleinfo` FOR EACH ROW BEGIN
    call update_vehicleinfo_update_time();
  END
;;
DELIMITER ;
